import sys

def main():
    input = sys.stdin.readlines()
    input = [int(x) for x in input[0].split()]
    output = 0
    for x in input:
        for y in input:
            if x != y:
                output += x + y
    print(output)

main()

def main():
    n = int(input())
    a = list(map(int, input().split()))
    count = 0
    for i in range(n):
        for j in range(i+1, n):
            if a[i] > a[j]:
                count += 1
    print(count)

if __name__ == '__main__':
    main()

